let obj = {}
for(let key of keys){
  let s = JSON.stringify(key)
  if(!obj[s]) obj[s] = 0;
  obj[s] += 0.5 + Math.random()
}

let obj = {}
for(let key of keys){
  let p = obj;
  for(let part of key){
    if(!p[part]) p[part] = {};
    p = p[part]
  }
  if(!p.value) p.value = 0;
  p.value += 0.5 + Math.random()
}

